import React from "react";
import { Card } from "react-bootstrap";
import "./movieCard.css";

const Movie = (props) => {
  return (
    <div className="col s12 m6 l3" style={{ whiteSpace: "nowrap" }}>
      <Card style={{ height: "auto", width: "auto" }}>
        <Card.Img
          variant="top"
          src={"http://image.tmdb.org/t/p/w185" + props.image}
          style={{ height: "50%" }}
        />
        <Card.Body>
          <Card.Title className="tescss">{props.title}</Card.Title>
          <Card.Text>{props.overview}</Card.Text>
        </Card.Body>
      </Card>

      {/* <div class="card">
          <div className="card-image waves-effect waves-block waves-light">
            {props.image == null ? (
              <img
                src={""}
                alt="card image"
                style={{ width: "100%", height: 300 }}
              />
            ) : (
              <img
                src={"http://image.tmdb.org/t/p/w185" + props.image}
                alt="card image"
                style={{ width: "100%", height: 300 }}
              />
            )}
          </div>
          <div className="card-title">{props.title}</div>
        </div> */}
    </div>
  );
};

export default Movie;
